    // ブロック状態を追跡
    let isBlocked = false;
    let blockReason = '';
    let blockedWords = [];

    // 正規表現用のエスケープ関数
    function escapeRegExp(string) {
        return string.replace(/[.*+?^${}()|[\]\\]/g, '\\$&');
    }

    // 現在のドメインがブロックリストに含まれているかチェック
    function isDomainBlocked() {
        const currentDomain = window.location.hostname.toLowerCase();

        // 許可リストに含まれるドメインはブロックしない
        for (const allowedDomain of allowedDomains) {
            if (currentDomain === allowedDomain.toLowerCase() ||
                currentDomain.endsWith('.' + allowedDomain.toLowerCase())) {
                debugLogLevel('basic', `ドメイン ${currentDomain} は許可リストに含まれています`);
                return false;
            }
        }

        // ブロックリストをチェック
        for (const blockedDomain of blockedDomains) {
            if (currentDomain === blockedDomain.toLowerCase() ||
                currentDomain.endsWith('.' + blockedDomain.toLowerCase())) {
                blockReason = 'domain';
                debugLogLevel('basic', `ドメイン ${currentDomain} はブロックされています`);
                return true;
            }
        }

        return false;
    }

    // 現在のURLがブロックリストに含まれているかチェック
    function isUrlBlocked() {
        const currentUrl = window.location.href.toLowerCase();

        // 許可リストに含まれるドメインのURLはチェックしない
        const currentDomain = window.location.hostname.toLowerCase();
        for (const allowedDomain of allowedDomains) {
            if (currentDomain === allowedDomain.toLowerCase() ||
                currentDomain.endsWith('.' + allowedDomain.toLowerCase())) {
                return false;
            }
        }

        // ブロックリストをチェック
        for (const blockedUrl of blockedUrls) {
            if (currentUrl === blockedUrl.toLowerCase()) {
                blockReason = 'url';
                debugLogLevel('basic', `URL ${currentUrl} はブロックされています`);
                return true;
            }
        }

        return false;
    }

    // 追加: 単語検索関数（日本語の単語境界を考慮）
    function containsWord(text, word) {
        // 単語をエスケープ
        const escapedWord = escapeRegExp(word);

        // デバッグログの準備
        let detectionMethod = '';
        let detected = false;

        // 日本語は単語境界が明確でないため、複数の検出方法を試みる

        // 1. 完全一致 (「勧誘」という単語がそのまま含まれているか)
        if (text.includes(word)) {
            detectionMethod = '完全一致';
            detected = true;
        }
        // 2. 正規表現による一般的な検索 (特殊文字のエスケープを考慮)
        else if (new RegExp(escapedWord).test(text)) {
            detectionMethod = '正規表現';
            detected = true;
        }
        // 3. 複合語の検出 (「勧誘等」「ご勧誘」など、前後に他の文字が付いた形)
        // 日本語では単語の途中に他の文字が入ることは少ないので、単純に単語が含まれるかチェック
        else {
            const normalizedText = text.normalize('NFKC'); // Unicode正規化（全角/半角の違いを吸収）
            const normalizedWord = word.normalize('NFKC');

            if (normalizedText.indexOf(normalizedWord) !== -1) {
                detectionMethod = 'Unicode正規化';
                detected = true;
            }
        }



        // デバッグログ出力（verbose レベルのみ）
        if (DEBUG_CONFIG.enabled && DEBUG_CONFIG.logLevel === 'verbose') {
            if (detected) {
                debugLogLevel('verbose', `  [単語検出] "${word}" を検出: ${detectionMethod}`);

                // 単語の周辺テキストを表示（デバッグ用）
                const wordIndex = text.indexOf(word);
                if (wordIndex !== -1) {
                    const start = Math.max(0, wordIndex - 10);
                    const end = Math.min(text.length, wordIndex + word.length + 10);
                    const contextText = text.substring(start, end);
                    debugLogLevel('verbose', `  [単語コンテキスト] ...${contextText}...`);
                }
            } else if (word.length > 1) { // 短すぎる単語は省略
                debugLogLevel('verbose', `  [単語未検出] "${word}" は見つかりませんでした`);
            }
        }

        return detected;
    }

